import React, { useState, useRef, useEffect } from "react";
import "tailwindcss/tailwind.css";
import githubIcon from "./icons/github.png";
import behanceIcon from "./icons/behance.png";
import gmailIcon from "./icons/gmail.png";
import linkedinIcon from "./icons/linkedin.png";
import mediumIcon from "./icons/medium.png";

function Terminal() {
  const [command, setCommand] = useState("");
  const [output, setOutput] = useState([{ command: "", output: "" }]);
  const [welcomeMessage, setWelcomeMessage] = useState(
    "Welcome to my portfolio! To start exploring this Terminal type <i>help</i> then press enter. Note that the Tab Key helps you complete the commands."
  );
  const terminalRef = useRef(null);

  useEffect(() => {
    terminalRef.current.scrollTop = terminalRef.current.scrollHeight;
  }, [output]);

  function handleCommand(e) {
    e.preventDefault();
    const newOutput = [...output, { command: command, output: "" }];
    switch (command.toLowerCase()) {
      case "about":
        newOutput[newOutput.length - 1].output = "• More about me coming soon...";
        break;
      case "contact":
        newOutput[newOutput.length - 1].output = (
          <>
            <img src={gmailIcon} alt="Mail Icon" className="h-6 w-6 inline" /> staili.fatimazohra@gmail.com
          </>
        );
        break;
      case "socials":
        newOutput[newOutput.length - 1].output = (
          <>
            <img src={linkedinIcon} alt="LinkedIn Icon" className="h-6 w-6 inline" />{" "}
            <a href="https://www.linkedin.com/in/fatima-zohra-staili-681878200/" target="_blank" rel="noopener noreferrer">
              Linkedin
            </a>
            <br />
            <img src={mediumIcon} alt="Medium Icon" className="h-6 w-6 inline" />{" "}
            <a href="https://medium.com/@staili.fatimazohra" target="_blank" rel="noopener noreferrer">
              Medium
            </a>
            <br />
            <img src={behanceIcon} alt="Behance Icon" className="h-6 w-6 inline" />{" "}
            <a href="https://www.behance.net/fatimastaili" target="_blank" rel="noopener noreferrer">
              Behance
            </a>
            <br />
            <img src={githubIcon} alt="Github Icon" className="h-6 w-6 inline" />{" "}
            <a href="https://github.com/STAILII" target="_blank" rel="noopener noreferrer">
              Github
            </a>
          </>
        );
        break;
      case "help":
        newOutput[newOutput.length - 1].output = `
          • ${"about".padEnd(9, ' ')}: learn more about me
          • ${"contact".padEnd(9, ' ')}: get my e-mail address
          • ${"socials".padEnd(9, ' ')}: how to contact me online
          • ${"education".padEnd(9, ' ')}: my academic journey
          • ${"experience".padEnd(9, ' ')}: list of my work experiences
          • ${"projects".padEnd(9, ' ')}: list of my projects
          • ${"hobbies".padEnd(9, ' ')}: know more about what I like
          • ${"clear".padEnd(9, ' ')}: clear terminal
          • ${"get -cv".padEnd(9, ' ')}: download my cv
        `;
        break;
      case "get -cv":
        window.open('https://drive.google.com/file/d/1-hW5Jv4gIsJBmgOFwtrYrn99u6f94Lhw/view?usp=sharing', '_blank');
        break;
      case "clear":
        newOutput.length = 0;
        break;
      default:
        newOutput[newOutput.length - 1].output = "Unknown command. Type 'help' for a list of available commands.";
    }
    setOutput(newOutput);
    setCommand("");
  }

  function handleChange(e) {
    setCommand(e.target.value);
  }

  function handleKeyDown(e) {
    if (e.key === "Tab") {
      e.preventDefault();
      switch (command) {
        case "ab":
          setCommand("about");
          break;
        case "co":
          setCommand("contact");
          break;
        case "so":
          setCommand("socials");
          break;
        case "he":
          setCommand("help");
          break;
        case "cl":
          setCommand("clear");
          break;
        case "ge":
          setCommand("get -cv");
          break;
        default:
          break;
      }
    }
  }

  return (
    <div className="bg-black h-screen w-screen flex justify-center items-center">
      <div className="bg-gray-900 text-white text-left flex flex-col rounded-lg w-2/3 h-3/4">
        <div className="bg-gray-800 p-4 h-full overflow-auto" ref={terminalRef}>
          <div className="mb-6" dangerouslySetInnerHTML={{ __html: welcomeMessage }}></div>
          {output.map((item, index) => (
            <div key={index}>
              <div className="flex items-center">
                <div className="mr-2 text-blue-600 font-mono">visitor@terminal.staili : ~$</div>
                <pre className="text-green-500 inline">{item.command}</pre>
              </div>
              {item.output && (
                <div className="mt-2 ml-12">
                  <pre>{item.output}</pre>
                </div>
              )}
            </div>
          ))}
          <form onSubmit={handleCommand} className="flex items-center">
            <div className="mr-2 text-blue-600 font-mono">visitor@terminal.staili : ~$</div>
            <input
              type="text"
              value={command}
              onChange={handleChange}
              onKeyDown={handleKeyDown}
              className="flex-grow bg-transparent text-green-500 focus:outline-none border-b-2 border-green-500 font-mono"
            />
          </form>
        </div>
      </div>
    </div>
  );
}

export default Terminal;
